import React from 'react';
import { useHistory } from 'react-router-dom'; // react-router-dom'dan useHistory import ediyoruz
import MenuIcon from '@mui/icons-material/Menu';
import '../styles/MenuAppBar.css';
import LogoImage from '../assets/logo.jpeg';
import OtherHousesOutlinedIcon from '@mui/icons-material/OtherHousesOutlined';
import LocationIcon from '@mui/icons-material/LocationOn';
 // LocationIcon'u import ediyoruz

function MenuAppBar() {
  const history = useHistory(); // useHistory hook'unu kullanarak history nesnesini alıyoruz

  const navigateToLocation = () => {
    // LocationIcon butonuna tıklandığında çalışacak fonksiyon
    history.push('/location.js'); // İstenilen yola göre history.push ile yönlendirme yapılır
  };

  return (
    <div>
      <div className='navbar'>
        <div className="img-navbarLogo" style={{ backgroundImage: `url(${LogoImage})`, width: '50px' }}></div>
        <button style={{ backgroundColor: 'white', cursor: 'pointer', border: 'none', height: '7vmin' }}>
          <OtherHousesOutlinedIcon />
        </button>
        <button style={{ cursor: 'pointer', backgroundColor: 'white', border: 'none', height: '5vmin' }} onClick={navigateToLocation}>
          <LocationIcon /> {/* LocationIcon butonu ve onClick event handler */}
        </button>
        <div>
          <button style={{ cursor: 'pointer', backgroundColor: 'white', border: 'none', height: '5vmin' }}>
            <MenuIcon />
          </button>
        </div>
      </div>
    </div>
  );
}

export default MenuAppBar;
